import  React, { Component } from 'react';
import axios from 'axios';
import Nav from './Nav';
import Search from './Search';

class App extends Component {

  constructor() {
    super();
    this.state = {
      photos: []
    }
  }

  componentDidMount() {
    axios.get('https://www.flickr.com/services/rest/?method=flickr.photos.search&api_key=80b53bdd52104a7e511ad1a80c986b77&tags=travel%2C+food%2C+dogs&per_page=24&format=json&nojsoncallback=1')
      .then((response) => {
        this.setState({
          photos: response.data.photo
        })
      })
      .catch(function (error) {
        console.log(error);
      });
  }

  render() {
    return (
      <div className="container">
        <Search />
        <Nav />
      </div>
    );
  }
}

export default App;
